I try to keep my lip combos minimal with two products, but sometimes i like to mix and match 3-4 products. 😂 here’s one of them. If you don’t have the @hudabeauty lip liner, go for mars, it’s not a direct dupe, but the colour payoff is similar. 
Deets :
@hudabeauty lip liner
@mruchabeauty plush pout lipstick
@milanicosmetics_india color fetish hydrating lip stain ( easily one of my fav shades) 

